const SignUp = () => {



    return (
      <div>
        <h1>SignUp</h1>
      


      
      {/* <div class="register"><span class="registerTitle">Register</span> */}
     
     
     
          <form class="SignUpForm"><label>Username</label>
            <input type="text" class="SignUpInput" placeholder="Enter your username..." />
            <label>Email</label><input type="text" class="SignUpInput" placeholder="Enter your email..." />
            <label>Password</label><input type="password" class="SignUpInput" placeholder="Enter your password..."/>
            <button class="SignUpButton" type="submit"></button>
          </form>
          
        </div>
    
  );




}
export default SignUp;
